import React from 'react'
import Card from './Card';
import Card1 from '../assets/img/Card1.jpg'
import Card2 from '../assets/img/Card2.jpg'
import Card3 from '../assets/img/Card3.jpg'
import Card4 from '../assets/img/Card4.jpg'
import { title } from 'process';
interface IProps{

}
interface IState{

}
class CardSection extends React.Component<IProps,IState>
{
    constructor(props:IProps)
    {
        super(props);
    }
    render()
    {
        return(
            <React.Fragment>
                <section>
  <div className="containor mt-2">
      <div className='row'>
          <div className='col-md-3'>
              <Card img={Card1} title='Sugar Baby Rasmalai  ' content='Ras malai or rossomalai or rasamalei is a dessert originating from the Indian subcontinent. The dessert is called rossomalai in the Bengali language, ras malai in Urdu and Hindi and rasa malei in Odia.'/>
          
  </div>
  <div className='col-md-3'>
              <Card img={Card2} title='Sweet Tooth Rasgulla'content='Rasgulla or rossomalai or rasgulla is a dessert originating from the Indian subcontinent. The dessert is called rossomalai in the Bengali language, ras malai in Urdu and Hindi and rasa malei in Odia.'/>
          
  </div>
  <div className='col-md-3'>
              <Card img={Card3} title='Sugary Sweet Dilbhar'content='Dilbhar or rossomalai or rasamalei is a dessert originating from the Indian subcontinent. The dessert is called rossomalai in the Bengali language, ras malai in Urdu and Hindi and rasa malei in Odia.'/>
          
  </div>
  <div className='col-md-3'>
              <Card img={Card4} title='Sweet As Sugar Rabdi Cake'content='Rabdi Cake or rossomalai or rasamalei is a dessert originating from the Indian subcontinent. The dessert is called rossomalai in the Bengali language, ras malai in Urdu and Hindi and rasa malei in Odia.'/>
          
  </div>
  </div>
  </div>
  
          

      </section>
            </React.Fragment>
        );
    }
}

export default CardSection;
